export default function ExpenseDate({date}) {
  const day = date.toLocaleString('en-Us', {day: '2-digit'});
  const month = date.toLocaleString('en-Us', {month: 'long'});
  const year = date.getFullYear();

  return (
    <div>
        <div>{month}</div>
        <div>{day}</div>
        <div>{year}</div>
    </div>
  )
}
